import React from "react";
import { Col, Row } from "react-bootstrap";

function DatabaseStack() {
    const defaultImg = process.env.PUBLIC_URL + '/uwmadison.jpg'; // 统一的备用图片路径
    return (
        <Row style={{ justifyContent: "center", paddingBottom: "50px"}}>
            <Col xs={4} md={2} className="tech-icons">
                <img src={defaultImg} length={150} width={150} title="MySQL" alt="MySQL"/>
            </Col>
            <Col xs={4} md={2} className="tech-icons">
                <img src={defaultImg} length={150} width={150} title="Redis" alt="Redis"/>
            </Col>
            <Col xs={4} md={2} className="tech-icons">
                <img src={defaultImg} length={150} width={150} title="Firebase" alt="Firebase"/>
            </Col>
            <Col xs={4} md={2} className="tech-icons">
                <img src={defaultImg} length={150} width={150} title="SQL Server" alt="SQL Server"/>
            </Col>
            <Col xs={4} md={2} className="tech-icons">
                <img src={defaultImg} length={150} width={150} title="Snowflake" alt="Snowflake"/>
            </Col>
        </Row>
    );
}

export default DatabaseStack;
